def count_square_brackets(text):
    """Counts the number of opening and closing square brackets in a string.

    Args:
        text: The input string.

    Returns:
        The total count of square brackets.
    """
    count = 0
    for char in text:
        if char == '[' or char == ']':
            count += 1
    return count

